BlocklyGamesMsg["Pond.helpText1"] = "Përdorni komandën 'cannon' për të goditur objektivin. Parametri i parë është këndi, parametri i dytë është largësia. Gjeni kombinimin e duhur.";
BlocklyGamesMsg["Pond.helpText2"] = "Ky objektiv duhet të goditet shumë herë. Përdorni një 'qark' 'while (true)' për të bërë diçka pa fund.";
BlocklyGamesMsg["Pond.helpText3a"] = "Ky kundërshtar lëviz prapa dhe mbrapa, duke e bërë të vështirë për t'u goditur. Shprehja 'scan' kthen distancën e saktë të kundërshtarit në drejtimin e caktuar.";
BlocklyGamesMsg["Pond.helpText3b"] = "Ky  është pikërisht ajo që komanda e 'cannon' duhet të zjarri me saktësi.";
BlocklyGamesMsg["Pond.helpText4"] = "Ky kundërshtar është shumë larg për ta përdorur topin (i cili ka një limit prej 70 metrash). Në vend të kësaj, përdorni komandën 'swim' për të filluar notimin ndaj kundërshtarit dhe përplasuni në të.";
BlocklyGamesMsg["Pond.helpText5"] = "Ky kundërshtar është gjithashtu shumë larg për të përdorur topin. Por ti je shumë i dobët për të mbijetuar një përplasje. Noto drejt kundërshtarit ndërsa vendndodhja yte horizontale është më pak se 50. Pastaj 'ndalo' dhe përdor topin.";
BlocklyGamesMsg["Pond.helpText6"] = "Ky kundërshtar do të largohet kur të goditet. Noto drejt tij nëse është jashtë rrezes së veprimit (70 metra).";
BlocklyGamesMsg["Gallery"] = "Galeria";
